import React from "react";
// import {v4 as uuid } from "uuid";
import Dog from "./Dog";

const DogList = ({dogs}) => {
    return (
        <div className="DogList">
            {dogs.map((dog, index)=> (
                <Dog 
                key={index}
                name={dog.name}
                age={dog.age}
                src={dog.src}
                facts={dog.facts}
                />
            ))}
        </div>
    )
};

export default DogList;
